import React from 'react'
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native'

import HomePage from '../pages/HomePage';
import Search from '../pages/Search';

import { AntDesign } from '@expo/vector-icons';

const { Navigator, Screen } = createBottomTabNavigator();

export function AppRoutes (){
    return (
       <NavigationContainer>
            <Navigator screenOptions={{ 
                tabBarActiveTintColor: '#CBAA6C',
                tabBarInactiveTintColor: '#CBAA6C',
                tabarIconStyle: {
                    textShadowColor: '#gray',
                    textShadowOffset: { widht: 0, height: 0 },
                    textShadowRadius: 5
                },
                tabBarLabelStyle: {
                    textShadowColor: 'gray',
                    textShadowOffset: {widht: 0, height: 0 },
                    textShadowRadius: 3,
                }

             }}>
                                   
                <Screen name="HomePage"
                    component={HomePage}
                    options={{
                        tabBarIcon: ( ) => {
                            return <AntDesign name="home" size={24} color="#CBAA6C" />
                        }
                    }}/>
                <Screen name="Search"
                 component={Search}
                 options={{
                    tabBarIcon: ( ) => {
                        return <AntDesign name="search1" size={24} color="#CBAA6C" />
                         } 
                         }}/>
        </Navigator>
       </NavigationContainer>
    )
}
